inline constexpr std::uint_fast64_t PrimaryHash(wxStringCharType const *const name)
{
    std::uint_fast64_t const h = Hash(name);
    auto const it = std::ranges::lower_bound( g_alternative_names, h, {}, &AlternativeNameEntry::hash );
    if ( (it != std::end(g_alternative_names)) && (it->hash == h) ) return it->primary_hash;
    auto const it2 = std::ranges::lower_bound( g_primary_names, h, {}, [](auto const &e) { return e.first; } );
    if ( (it2 != std::end(g_primary_names)) && (it2->first == h) ) return it2->first;
    return 0u;
}

inline constexpr wxStringCharType const *Primary(wxStringCharType const *const name)
{
    std::uint_fast64_t const h = PrimaryHash(name);
    auto const it = std::ranges::lower_bound( g_primary_names, h, {}, [](auto const &e){ return e.first; } );
    if ( (it != std::end(g_primary_names)) && (it->first == h) ) return it->second;
    return nullptr;
}

inline std::vector<wxStringCharType const*> GetAllAlternatives(std::uint_fast64_t const primary_hash)
{
    std::vector<wxStringCharType const*> result;
    auto const myrange = std::ranges::equal_range( g_alternative_names, primary_hash, {}, &AlternativeNameEntry::primary_hash );
    for ( auto it = myrange.begin(); it != myrange.end(); ++it ) result.emplace_back( it->name );
    return result;
}
